(1, 1, 1, '1', '1', 'Быть миролюбивым и стремиться к миру в целом', 'Оценка 100 для того, кто ненавидит войну и ссоры и легко пойдет дальше своего права не разрушать мир, ведь для него установление мира более красочно, чем установление справедливости.'),
(2, 2, 1, '   Being peaceful and seeking peace in general', ' the score of 100 is for someone who hates fights and quarrels  so would easily ignore  their  right in order to maintain the peace. In fact, establishing peace is more important than establishing justice for them.   ', 'Being peaceful and seeking peace in general', 'A score of 100 is for someone who hates war and quarrels and will easily go beyond his right to not destroy peace. In fact, for him, establishing peace is more colorful than establishing justice.'),
(3, 3, 1, 'صلح جویی و جویای صلح بودن در حالت کلی', 'نمره 100 برای کسی است که از جنگ و دعوا بیزار است و برای از بین نرفتن صلح براحتی از حق خودش هم میگذرد .در واقع برقراری صلح برای او از برقراری عدالت هم پر رنگ تر است.', 'صلح جویی و جویای صلح بودن در حالت کلی', 'نمره 100 برای کسی است که از جنگ و دعوا بیزار است و برای از بین نرفتن صلح براحتی از حق خودش هم میگذرد .در واقع برقراری صلح برای او از برقراری عدالت هم پر رنگ تر است.'),
(4, 1, 2, NULL, NULL, 'гедонизм (способность наслаждаться)', '100 баллов — для тех, кто может найти положительные моменты, чтобы наслаждаться даже в плохие моменты, и обычно не нуждается в средствах для создания таких моментов.'),
(5, 2, 2, ' hedonism (ability to enjoy)', 'the score of 100 is for someone who can find a positive point to enjoy the moments  even in bad situations and usually does not need any facilities to create these moments.  ', 'hedonism (ability to enjoy)', 'A score of 100 is for someone who can find a positive point to enjoy even in bad moments and usually does not need facilities to create these moments.'),
(6, 3, 2, 'لذت جویی (توانایی در لذت بردن)', 'نمره 100 برای کسی است که میتواند در تمام لحظات حتی بد  نقطه مثبتی را بیابد که از آن لذت ببرد و معمولا در ساخت این لحظات احتیاج به امکانات ندارد.\n ', 'لذت جویی (توانایی در لذت بردن)', 'نمره 100 برای کسی است که میتواند در تمام لحظات حتی بد  نقطه مثبتی را بیابد که از آن لذت ببرد و معمولا در ساخت این لحظات احتیاج به امکانات ندارد.'),
