(33, 1, 12, NULL, NULL, 'Желание яркой одежды', 'Оценка 100 для тех, у кого всегда есть желание покупать и носить яркую одежду, если их не заставляют, и в большинстве случаев они рекомендуют это другим.'),
(34, 2, 12, ' -Desire for colorful clothes', 'the score of 100 is for someone who always has the desire to buy and use colorful clothes (when they are not forced to), and in most cases, they recommend it to others, as well. ', 'Desire for colorful clothes', 'A score of 100 is for someone who always has the desire to buy and use colorful clothes if they are not forced, and in most cases, they recommend it to others.'),
(35, 3, 12, 'تمایل به لباسهای رنگی', 'نمره 100 برای کسی است که همیشه و مدام در صورت نداشتن اجبار،تمایل به خرید و استفاده از لباسهای رنگی دارد و در بیشتر موارد به دیگران نیز پیشنهاد میکند.', 'تمایل به لباسهای رنگی', 'نمره 100 برای کسی است که همیشه و مدام در صورت نداشتن اجبار،تمایل به خرید و استفاده از لباسهای رنگی دارد و در بیشتر موارد به دیگران نیز پیشنهاد میکند.'),
(36, 1, 13, NULL, NULL, 'Потенциал использования преувеличения и воображения в речи', '100 баллов - тому, у кого в речи и разговоре преувеличены сюжеты, сочетающиеся с воображением обычных предметов (не со зла), на самом деле этот человек рассказывает о своих снах в этом предмете.'),
(37, 2, 13, ' -The potential of using exaggeration and imagination in speech: Exaggerated speech and storytelling of ordinary subjects (not out of malignancy. In fact, this person is talking about his wishes in this subject)', 'the score of 100 is for someone who has exaggerated stories in his speech and conversation, combined with imagination of ordinary subjects (not out of malignancy). In fact, this person is talking about his wishes in this subject. ', 'The potential of using exaggeration and imagination in speech', 'A score of 100 is for someone who has exaggerated stories in his speech and conversation, combined with imagination of ordinary subjects (not out of malice). In fact, this person is talking about his dreams in that subject.'),
(38, 3, 13, 'پتانسیل استفاده از اغراق و تخیل درگفتار', 'نمره 100 برای کسی است که در گفتار و محاوره داستانسازی اغراق گونه و ترکیب شده با تخیل از موضوعات معمولی (نه از روی بدجنسی)  دارد .در واقع این فرد در حال صحبت از آرزوهای خود در آن موضوع است). ', 'پتانسیل استفاده از اغراق و تخیل درگفتار', 'نمره 100 برای کسی است که در گفتار و محاوره داستانسازی اغراق گونه و ترکیب شده با تخیل از موضوعات معمولی (نه از روی بدجنسی)  دارد .در واقع این فرد در حال صحبت از آرزوهای خود در آن موضوع است).'),
(39, 1, 14, NULL, NULL, 'Степень желания спать по утрам', 'Оценка 100 предназначена для тех, кто обычно не хочет, чтобы его будили утром люди, часы или сила.'),
(40, 2, 14, ' - desire to sleep in the morning', 'the score of 100 is for someone who usually does not want to be woken up by a person or by the clock or by force in the morning. ', 'The degree of desire to sleep in the morning', 'A score of 100 is for someone who usually does not want to be woken up in the morning by a person or by the clock or by force.'),
(41, 3, 14, 'میزان تمایل به خواب صبحگاهی', 'نمره 100 برای کسی است که معمولا در ساعت صبح تمایلی به بیدار شدن توسط شخص و یا ساعت و یا اجبار ندارد .حتی اگر صبح زود هم بیدار شود این دیدگاه را دارد که با میل خودش چشمانش را باز کند.', 'میزان تمایل به خواب صبحگاهی', 'نمره 100 برای کسی است که معمولا در ساعت صبح تمایلی به بیدار شدن توسط شخص و یا ساعت و یا اجبار ندارد .حتی اگر صبح زود هم بیدار شود این دیدگاه را دارد که با میل خودش چشمانش را باز کند.'),
(42, 1, 15, NULL, NULL, 'Заинтересованы в толпе и вечеринках', '100 баллов для того, кто постоянно находится в состоянии приглашать других или положительно отвечает на приглашения других и наслаждается этим состоянием.'),
(43, 2, 15, '  Interest in crowds and parties', 'the score of 100 is for someone who is constantly in a state of inviting others or responding positively to others\' invitations and enjoys this  attitude. ', 'Interested in crowds and parties', 'A score of 100 is for someone who is constantly in a state of inviting others or responding positively to others\' invitations and enjoys this state.'),
(44, 3, 15, 'علاقمندی به شلوغی و میهمانی', 'نمره 100 برای کسی است که  مدام در حالت دعوت دیگران و یا به دعوت دیگران جواب مثبت دادن است و از این حالت لذت می برد.\n', 'علاقمندی به شلوغی و میهمانی', 'نمره 100 برای کسی است که  مدام در حالت دعوت دیگران و یا به دعوت دیگران جواب مثبت دادن است و از این حالت لذت می برد.'),
(45, 1, 16, NULL, NULL, 'Умение не замечать ошибок', '100 баллов — для того, кто может не заметить любую ошибку и иногда сердится на себя.'),
(46, 2, 16, ' - Ability to overlook mistakes', 'the score of 100 is for someone who can overlook any mistake and sometimes gets angry with himself. ', 'Ability to overlook mistakes', 'A score of 100 is for someone who can overlook any mistake and sometimes gets angry with himself.'),
(47, 3, 16, 'توان چشم پوشی از خطاها', 'نمره 100 برای کسی است که از هر خطایی میتواند چشم پوشی کند .و گاها از خودش هم از این بابت عصبانی میشود.\n   ', 'توان چشم پوشی از خطاها', 'نمره 100 برای کسی است که از هر خطایی میتواند چشم پوشی کند .و گاها از خودش هم از این بابت عصبانی میشود.'),
(48, 1, 17, NULL, NULL, 'Способность договориться с супругом', '100 баллов — для того, кто выходит за рамки собственного мнения и советуется с женой, когда в жизни возникают разногласия.'),
(49, 2, 17, ' -Ability to agree with spouse', 'the score of 100 is for those who ignore their own opinions and consult with their spouse when there are differences in life. ', 'Ability to agree with spouse', 'A score of 100 is for someone who goes beyond his own opinions and consults with his wife when there are differences in life.'),
(50, 3, 17, 'توان هم نظری با همسر', 'نمره 100 برای کسی است که در هنگام اختلاف های پیش آمده در زندگی از نظرات خود گذشته و با همسرش هم نظر گردد.', 'توان هم نظری با همسر', 'نمره 100 برای کسی است که در هنگام اختلاف های پیش آمده در زندگی از نظرات خود گذشته و با همسرش هم نظر گردد.'),
(51, 1, 18, 'Эмоциональная уязвимость', NULL, 'Уязвимость через эмоции', 'Оценка 100 для того, кто важнее всего на свете в отношениях, например, в драке, даже если его побьют, он не будет настолько эмоционально поврежден, чтобы слышать плохие и эмоционально неуместные предложения.'),
(52, 3, 18, ' آسیب پذیری از طریق احساسات', 'نمره 100 برای کسی است که در روابط حرف احساسی از هر چیز دیگری برای او مهم تر است  برای مثال در یک دعوا حتی اگر کتک بخورد آنقدر اسیب روحی نمیخورد تا آنکه جملات بد و ناشایست عاطفی را بشنود.', 'آسیب پذیری از طریق احساسات', 'نمره 100 برای کسی است که در روابط حرف احساسی از هر چیز دیگری برای او مهم تر است  برای مثال در یک دعوا حتی اگر کتک بخورد آنقدر اسیب روحی نمیخورد تا آنکه جملات بد و ناشایست عاطفی را بشنود.'),
(53, 1, 19, 'Склонность к романтическому сексу', NULL, 'Заинтересован в романтическом сексе', 'Оценка 100 для того, кто любит долгие флирты перед половым актом и полные романтических и мистических предложений во время секса и максимально любит окружающую среду.'),
(54, 2, 19, '    -Interested in romantic sex', 'the score of 100 is for someone who likes long flirtations before intercourse with lots  of romantic and mystical sentences during sex.   ', 'Interested in romantic sex', 'A score of 100 is for someone who likes long flirtations before intercourse and full of romantic and mystical sentences during sex and likes the environment as much as possible.'),
(55, 3, 19, 'علاقمندی به سکس رومانتیک', 'نمره 100 برای کسی است که در هنگام سکس دوست دارد معاشقه های قبل از نزدیکی او طولانی و پر از جملات عاشقانه و عارفانه باشد و تا حد ممکن محیط را هم بدین شکل دوست دارد.', 'علاقمندی به سکس رومانتیک', 'نمره 100 برای کسی است که در هنگام سکس دوست دارد معاشقه های قبل از نزدیکی او طولانی و پر از جملات عاشقانه و عارفانه باشد و تا حد ممکن محیط را هم بدین شکل دوست دارد.'),
(56, 1, 20, 'Интроверсия  и секс', NULL, 'интроверсия в сексе', 'Оценка 100 для того, кто не любит говорить и говорить о себе и другой стороне во время секса, и больше любит молчать, и обычно занимается глубоким сексом без обычных эмоций.'),
(57, 2, 20, '   -Introversion in sex', 'the score of 100 is for someone who doesn\'t like talking and hearing about themselves  during the sex, and enjoys more being silent, and usually has a deep sex without the usual emotions.   ', 'Introversion in sex', 'A score of 100 is for someone who doesn\'t like talking and talking about himself and the other party during sex, and enjoys more in silence, and usually has deep sex without the usual emotions.'),
(58, 3, 20, 'درونگرایی در سکس', 'نمره 100 برای کسی است که در انجام سکس از گفتار و حرف زدن خودش و طرف مقابل خوشش نمی آید و در سکوت لذت بیشتری میبرد و معمولا عمیق و بدون هیجانات معمول سکس دارد.', 'درونگرایی در سکس', 'نمره 100 برای کسی است که در انجام سکس از گفتار و حرف زدن خودش و طرف مقابل خوشش نمی آید و در سکوت لذت بیشتری میبرد و معمولا عمیق و بدون هیجانات معمول سکس دارد.'),
