(64, 3, 22, 'آسیب پذیری از بی مهری', 'نمره 100 برای کسی است که که در روابط نزدیک چنانچه مورد بی مهری قرار گیرد بشدت افسرده شده و در خود فرو میرود .', 'آسیب پذیری از بی مهری', 'نمره 100 برای کسی است که که در روابط نزدیک چنانچه مورد بی مهری قرار گیرد بشدت افسرده شده و در خود فرو میرود .'),
(65, 1, 23, NULL, NULL, 'Эффективность пищевого поощрения', 'Оценка 100 для ребенка, который перед хорошей работой, которую он сделал, если вы поощряете его съесть что-нибудь, он получает много энергии и выражает эту проблему и продолжает свою хорошую работу, и этот эффект сохранится в его существо.'),
(66, 2, 23, ' -Effectiveness of food reinforcement', 'the score of 100 is for a child who gets a lot of energy, if you encourage him to eat something in exchange for a good work he has done and he expresses this issue and continues his good work, and this impression will remain in his manner. ', 'Effectiveness of food encouragement', 'A score of 100 is for a child who, in front of a good work he has done, if you encourage him to eat something, he gets a lot of energy and expresses this issue and continues his good work, and this effect will remain in his being.'),
(67, 3, 23, 'تاثیر پذیری از تشویق خوراکی', 'نمره 100 برای کودکی است که در مقابل کار خوبی که انجام داده چنانچه اورا تشویق به یک خوراکی  کنید بشدت انرژی گرفته و این موضوع را بیان میکند و به کار خوبش ادامه میدهد و این تاثیر در وجودش ماندگار میشود.', 'تاثیر پذیری از تشویق خوراکی', 'نمره 100 برای کودکی است که در مقابل کار خوبی که انجام داده چنانچه اورا تشویق به یک خوراکی  کنید بشدت انرژی گرفته و این موضوع را بیان میکند و به کار خوبش ادامه میدهد و این تاثیر در وجودش ماندگار میشود.'),
