(136, 1, 47, NULL, NULL, 'быть спонтанным', 'Оценка 100 – это человек, который добровольно участвует в любой работе, даже не входящей в его обязанности, например, в партиях в качестве помощника, и вступает в деятельность, не приглашая других.'),
(137, 2, 47, ' -To be spontaneous', 'the score of 100 is for a person who volunteers in any work that is not even part of his/her duties, And enters into the activities as a helper without being invited by others. ', 'to be spontaneous', 'A score of 100 is for a person who volunteers in any work that is not even part of his duties, for example, in parties as a helper and enters into the activity without inviting others.'),
(138, 3, 47, 'خودجوش بودن', 'نمره 100 برای کسی است که  در هر کاری که حتی جزو وظایفش هم نیست مثلا در میهمانی ها بعنوان کمک داوطلب است و بدون دعوت دیگران وارد فعالیت میشود.\n', 'خودجوش بودن', 'نمره 100 برای کسی است که  در هر کاری که حتی جزو وظایفش هم نیست مثلا در میهمانی ها بعنوان کمک داوطلب است و بدون دعوت دیگران وارد فعالیت میشود.'),
(139, 1, 48, 'Оптимизм', NULL, 'оптимизм', ''),
(140, 2, 48, ' Optimism', NULL, 'optimism', ''),
(141, 3, 48, 'خوش بینی', NULL, 'خوش بینی', ''),
(142, 1, 49, NULL, NULL, 'Доброжелательность к другим', '100 баллов – для того, кто, несмотря на дискомфорт и темноту, всегда желает добра другим, и его добрая воля признается.'),
(143, 2, 49, ' Benevolence for others', 'A score of 100 is for someone who always wants good for others, and his/her good will is recognized, regardless of any discomfort and darkness', 'Benevolence for others', 'A score of 100 is for someone who, regardless of discomfort and darkness, always wants good for others, and his good will is recognized.'),
(144, 3, 49, 'خیر خواهی برای دیگران', 'نمره 100 برای کسی است که بدون ملاحظه و بدون در نظر گرفتن ناراحتی و کدورت ،همیشه و همیشه  خواستار خیر برای دیگران است و خیر خواهیش زبانزد میشود.', 'خیر خواهی برای دیگران', 'نمره 100 برای کسی است که بدون ملاحظه و بدون در نظر گرفتن ناراحتی و کدورت ،همیشه و همیشه  خواستار خیر برای دیگران است و خیر خواهیش زبانزد میشود.'),
(145, 1, 50, 'Умение  довольствоваться малым', NULL, 'общее удовлетворение', '100 баллов – для того, кто всегда всем доволен и не протестует, если его что-то не устраивает.'),
(146, 2, 50, '  -General satisfaction', 'the score of 100 is for someone who is always satisfied with everything and does not protest if he/she is not satisfied.  ', 'general satisfaction', 'A score of 100 is for someone who is always satisfied with everything and does not protest if he is not satisfied.'),
(147, 3, 50, 'رضایت داشتن عمومی(قانع بودن)', 'نمره 100 برای کسی است که همیشه از همه چیز راضی است و اگر هم راضی نباشد معترض نیست .\n', 'رضایت داشتن عمومی(قانع بودن)', 'نمره 100 برای کسی است که همیشه از همه چیز راضی است و اگر هم راضی نباشد معترض نیست .'),
(148, 1, 51, 'Стремление руководить (в сравнении с самыми выдающимися лидерами)', NULL, 'Лидерский талант', 'Оценка 100 для того, кто может руководить организацией наилучшим образом без ущерба (по сравнению с высшим руководством в мире).'),
(149, 2, 51, '   Leadership talent (compared to the highest leaders in the world)', 'the score of 100 is for someone who can lead an organization in the best possible way without any harm   ', 'Leadership talent', 'A score of 100 is for someone who can lead an organization in the best possible way without damage. (compared to the highest leadership in the world)'),
(150, 3, 51, 'استعداد رهبری ', 'نمره 100 برای کسی است که به بهترین نحوه ممکن بتواند یک تشکیلات را  بدون اسیب رهبری کند.(در مقایسه با بالاترین رهبری های دنیا )', 'استعداد رهبری', 'نمره 100 برای کسی است که به بهترین نحوه ممکن بتواند یک تشکیلات را  بدون اسیب رهبری کند.(در مقایسه با بالاترین رهبری های دنیا )'),
(151, 1, 52, NULL, NULL, 'потенциал мечты', '100 баллов – это человек, который в связи с жизненными течениями может легко создавать мечты, которые создадут в нем самом положительный результат, даже если он не предпримет ни шага в осуществлении или попытке достижения этих мечтаний.'),
(152, 2, 52, ' Dreaming potential', 'the score of 100 is for a person who can easily create dreams that will create a positive result in him/herself (in connection with the current stream of life), even if he/she does not take a step in implementing those dreams or trying to achieve them. ', 'Dream potential', 'A score of 100 is for a person who, in connection with the currents of life, can easily create dreams that will create a positive result in himself, even if he does not take a step in implementing or trying to achieve those dreams.'),
(153, 3, 52, 'پتانسیل رویاپردازی\n', 'نمره 100 برای کسی است که که در ارتباط با جریانات زندگی میتواند براحتی رویاهایی را بسازد که از آن نتیجه مثبتی را در خود ایجاد کند .حتی اگر در اجرا و یا تلاش به رسیدن آن رویاها قدمی بر ندارد.\n', 'پتانسیل رویاپردازی', 'نمره 100 برای کسی است که که در ارتباط با جریانات زندگی میتواند براحتی رویاهایی را بسازد که از آن نتیجه مثبتی را در خود ایجاد کند .حتی اگر در اجرا و یا تلاش به رسیدن آن رویاها قدمی بر ندارد.'),
(154, 1, 53, NULL, NULL, 'доверчивость', '100 баллов присуждается тому, кто сначала верит каждому разговору или новости, которую слышит, если не доказано обратное.'),
(155, 2, 53, ' Credulity', 'the score of 100 is for someone who believes every conversation or news he/she hears first, unless it is proven to be false. ', 'gullibility', 'A score of 100 is for someone who believes every conversation or news he hears first, unless proven otherwise.'),
(156, 3, 53, 'زودباوری', 'نمره 100 برای کسی است که هر صحبت و یا خبری را که میشنود در درجه اول باور میکند مگر اینکه خلاف آن اثبات شود.\n', 'زودباوری', 'نمره 100 برای کسی است که هر صحبت و یا خبری را که میشنود در درجه اول باور میکند مگر اینکه خلاف آن اثبات شود.'),
(157, 1, 54, 'Талант управления другими', NULL, 'Способность организовать', 'Оценка 100 для того, кто правильно и быстро организует человеческие силы в делах и кризисах, организациях и формированиях, чтобы дела не прерывались.'),
(158, 2, 54, '  Ability to organize', 'the score of 100 is for someone who organizes the human force correctly and quickly in organizations, formations and crises  so that the affairs do not get interrupted.  ', 'Ability to organize', 'A score of 100 is for someone who organizes the human force correctly and quickly in matters and crises and organizations and formations so that the affairs do not get interrupted.'),
(159, 3, 54, 'توان سازماندهی', 'نمره 100 برای کسی است که در امورات و بحرانها و سازمان ها و تشکیلات ،نیروی انسانی را بدرستی و با سرعت سازمان دهی کند تا امورات دچار وقفه نشود.', 'توان سازماندهی', 'نمره 100 برای کسی است که در امورات و بحرانها و سازمان ها و تشکیلات ،نیروی انسانی را بدرستی و با سرعت سازمان دهی کند تا امورات دچار وقفه نشود.'),
(160, 1, 55, NULL, NULL, 'Заставить других работать', 'Оценка 100 для того, кто всегда находится в состоянии юмора и серьезности, которые трудно отличить друг от друга, и имеет тенденцию заставлять других работать и не обязательно намеревается их раздражать.'),
(161, 2, 55, ' -Mocking others', 'the score of 100 is for someone who is always in a state of humor and seriousness that is hard to tell apart, and has a tendency to tease others but does not necessarily intend to annoy them. ', 'Putting others to work', 'A score of 100 is for someone who is always in a state of humor and seriousness that is hard to tell apart, and has a tendency to put others to work and does not necessarily intend to annoy others.'),
(162, 3, 55, 'سرکار گذاشتن دیگران', 'نمره 100 برای کسی است که مدارم در حالتی از طنز و جدیت که تشخیص تفکیک آنها سخت است تمایل به سر کار گذاشتن دیگران دارد و الزاما قصدش اذیت کردن دیگران نیست .\n', 'سرکار گذاشتن دیگران', 'نمره 100 برای کسی است که مدارم در حالتی از طنز و جدیت که تشخیص تفکیک آنها سخت است تمایل به سر کار گذاشتن دیگران دارد و الزاما قصدش اذیت کردن دیگران نیست .'),
(163, 1, 56, NULL, NULL, 'Быть неопрятным и грязным наедине', '100 баллов – для того, чья неупорядоченность и разгильдяйство высоки не из-за принуждения и социальных дел, а в нормальном состоянии без каких-либо внешних факторов. Большую часть этой неряшливости можно найти в частной жизни этих людей.'),
(164, 2, 56, ' Sloppiness', 'the score of 100 is for someone whose disorder and sloppiness is high not due to coercion and social affairs, but in a normal state without any external factors. Most of this sloppiness can be found in the privacy of these people. ', 'Being untidy and messy in private', 'A score of 100 is for someone whose disorder and sloppiness is high not due to coercion and social affairs, but in a normal state without any external factors. Most of this sloppiness can be found in the privacy of these people.'),
(165, 3, 56, 'نامرتب بودن و بهم ریختگی در خلوت', 'نمره 100 برای کسی است که بهم ریختگی و شلختگی او نه بواسطه اجبار و امور اجتماعی بلکه در حالت معمول و بدون هیچ عامل بیرونی بالا باشد . بیشتر این شلختگی را میتوان در خلوت این افراد یافت.', 'نامرتب بودن و بهم ریختگی در خلوت', 'نمره 100 برای کسی است که بهم ریختگی و شلختگی او نه بواسطه اجبار و امور اجتماعی بلکه در حالت معمول و بدون هیچ عامل بیرونی بالا باشد . بیشتر این شلختگی را میتوان در خلوت این افراد یافت.'),
(166, 1, 57, NULL, NULL, 'чувство юмора', '100 баллов присуждается человеку, который любит шутить и высмеивать других в своем повседневном поведении, и он делает это на пути к счастью других и избавлению их от страданий, и в его действиях нет насмешки. шутки.'),
(167, 2, 57, 'Sense of humor', 'the score of 100 is for a person who likes to joke and make fun of others in his daily behavior, and he does these things in the way of others\' happiness and to  take others out of their darkness, and there is no scorn in his/her jokes. ', 'sense of humor', 'A score of 100 is for a person who likes to joke and make fun of others in his daily behavior, and he does these things in the way of others\' happiness and to bring others out of their misery, and there is no ridicule in his jokes.'),
(168, 3, 57, 'شوخ طبعی', 'نمره 100 برای کسی است که در رفتارهای روز مره اش شوخی کردن و به شوخی گرفتن دیگران را دوست دارد و این اقذام را در مسیر شادی دیگران و بیرون اوردن دیگران از لاکشان انجام میدهد و در شوخی هایش تمسخر دیده نمیشود.\n', 'شوخ طبعی', 'نمره 100 برای کسی است که در رفتارهای روز مره اش شوخی کردن و به شوخی گرفتن دیگران را دوست دارد و این اقذام را در مسیر شادی دیگران و بیرون اوردن دیگران از لاکشان انجام میدهد و در شوخی هایش تمسخر دیده نمیشود.'),
(169, 1, 58, NULL, NULL, 'возбуждение', ''),
(170, 2, 58, 'Excitement', NULL, 'excitement', ''),
(171, 3, 58, 'شور و هیجان', NULL, 'شور و هیجان', ''),
(172, 1, 59, NULL, NULL, 'четко', ''),
(173, 2, 59, '-', NULL, 'clearly', ''),
(174, 3, 59, 'صراحت', NULL, 'صراحت', ''),
(175, 1, 60, NULL, NULL, 'забывчивость', ''),
(176, 2, 60, 'Forgetfulness', NULL, 'forgetfulness', ''),
(177, 3, 60, 'فراموشکاری', NULL, 'فراموشکاری', ''),
(178, 1, 61, 'Восприятие устной речи', NULL, 'Талант в словесном восприятии', 'Оценка 100 присуждается тому, кто, если вы предоставляете материал в виде изображения, речи или письма, обычно лучше понимает материал посредством разговорной и устной коммуникации или аудиофайла.'),
(179, 2, 61, '  -Talent in verbal perception', 'the score of 100 is for someone who usually has a better understanding of the material through speaking and verbal communication or an audio file in comparison with the form of an image, speech, or writing.  ', 'Talent in verbal perception', 'A score of 100 is for someone who, if you provide the material in the form of an image, speech, or writing, usually has a better understanding of the material through speaking and verbal communication or an audio file.'),
(180, 3, 61, 'استعداد در ادراک کلامی', 'نمره 100 برای کسی است که که اگر مطالب را به صورت یک تصویر و یا صحبت و یا نوشته در اختیارش بگذارید معمولا با صحبت کردن و ارتباط کلامی و یا فایل صوتی درک بهتری از مطالب دارد.', 'استعداد در ادراک کلامی', 'نمره 100 برای کسی است که که اگر مطالب را به صورت یک تصویر و یا صحبت و یا نوشته در اختیارش بگذارید معمولا با صحبت کردن و ارتباط کلامی و یا فایل صوتی درک بهتری از مطالب دارد.'),
(181, 1, 62, NULL, NULL, 'быть определенным', '100 баллов — это тот, кто серьезно и беспрекословно реализует свои решения, даже если они не обязательно правильны.'),
(182, 2, 62, ' -To be determined', 'the score of 100 is for someone who is serious and unquestioning in implementing their decisions, even though they may not necessarily be right. ', 'to be determined', 'A score of 100 is for someone who is serious and unquestioning in implementing their decisions, even though they may not necessarily be right.'),
(183, 3, 62, 'قاطعیت داشتن', 'نمره 100 برای کسی است که در اجرایی کردن تصمیمات خود جدی و بدون شک و تردید است با اینکه ممکن است الزاما درست نباشند.', 'قاطعیت داشتن', 'نمره 100 برای کسی است که در اجرایی کردن تصمیمات خود جدی و بدون شک و تردید است با اینکه ممکن است الزاما درست نباشند.'),
(184, 1, 63, NULL, NULL, 'Сила общения', '100 баллов – тому, кто в компании незнакомых людей сразу инициирует общение с окружающими и не нуждается в представлении.'),
(185, 2, 63, ' -The power of communicating', 'the score of 100 is for someone who immediately initiates communication with others in the company of strangers and does not need any introduction.  ', 'The power of communication', 'A score of 100 is for someone who, in the company of strangers, immediately initiates communication with others and does not need introduction.'),
(186, 3, 63, 'قدرت ارتباط برقرار کردن', 'نمره 100 برای کسی است که در جمع های غریبه ،بلافاصله نسبت به بر قراری ارتباط با دیگران اقدام میکند و نیاز به معارفه ندارد.\n', 'قدرت ارتباط برقرار کردن', 'نمره 100 برای کسی است که در جمع های غریبه ،بلافاصله نسبت به بر قراری ارتباط با دیگران اقدام میکند و نیاز به معارفه ندارد.'),
(187, 1, 64, NULL, NULL, 'Сила решения проблем', '100 баллов присуждается тому, кто обычно проявляет творческий подход к решению повседневных жизненных головоломок и всегда находит мудрый ответ на все, что другие считают и принимают рациональным.'),
(188, 2, 64, ' -Problem solving ', 'the score of 100 is for someone who usually has a creative mind in solving daily life puzzles and always has a wise answer for almost everything which is considered rational and acceptable. ', 'Problem solving power', 'A score of 100 is for someone who usually has a creative mind in solving daily life puzzles and always has a wise answer for anything that others consider and accept as rational.'),
(189, 3, 64, 'قدرت حل مسئله', 'نمره 100 برای کسی است که معمولا در حل معماهای روز مره و زندگی دارای ذهنی خلاق است و همیشه برای هر چیزی یک جواب عاقلانه دارد که دیگران آن را عقلانی دانسته و میپذیرند.\n', 'قدرت حل مسئله', 'نمره 100 برای کسی است که معمولا در حل معماهای روز مره و زندگی دارای ذهنی خلاق است و همیشه برای هر چیزی یک جواب عاقلانه دارد که دیگران آن را عقلانی دانسته و میپذیرند.'),
(190, 1, 65, NULL, NULL, 'Сила управления', '100 баллов — для тех, кто ценит лучшее управление людьми и человеческими ресурсами в домашних и рабочих делах или организациях.'),
(191, 2, 65, ' Management power', 'the score of 100 is for someone who has the ability to manage people and human resources in the best way in different work affairs or organizations. ', 'Management power', 'A score of 100 is for someone who appreciates managing people and human resources in the best way in home and work affairs or organizations.'),
(192, 3, 65, 'قدرت مدیریت', 'نمره 100 برای کسی است که در امورات منزل و کار و یا سازمانها و تشکیلات قدر مدیریت افراد و نیروی انسانی را به بهترین نحو دارد.\n', 'قدرت مدیریت', 'نمره 100 برای کسی است که در امورات منزل و کار و یا سازمانها و تشکیلات قدر مدیریت افراد و نیروی انسانی را به بهترین نحو دارد.'),
(193, 1, 66, NULL, NULL, 'Признательность', '100 баллов — для того, кто обязан себе за то, что другие делают для него, и всегда благодарен.'),
(194, 2, 66, ' Appreciation', 'the score of 100 is for someone who owes him/herself for what others did for him/her and is always grateful. ', 'Appreciation', 'A score of 100 is for someone who owes himself for what others do for him and is always grateful.'),
(195, 3, 66, 'قدر شناسی', 'نمره 100 برای کسی است که در قبال کارهایی که دیگران برایش انجام میدهند خود را مدیون کرده و همیشه قدر شناسی را دارد.\n', 'قدر شناسی', 'نمره 100 برای کسی است که در قبال کارهایی که دیگران برایش انجام میدهند خود را مدیون کرده و همیشه قدر شناسی را دارد.'),
(196, 1, 67, NULL, NULL, 'Открытость и коммуникабельность на публике', '100 баллов – это тот, кто всегда непредубежден в семье, на работе и в общественных местах и ​​ведет себя так, чтобы другие не чувствовали себя чужими по отношению к нему.');
INSERT INTO `item_title` (`id`, `languageID`, `itemID`, `title`, `description`, `title_temp`, `description_temp`) VALUES
(197, 2, 67, ' Generosity and sociability', 'the score of 100 is for a person who is always open to family, work and social gatherings and behaves in such a way that others do not feel strange towards him/her.', 'Openness and sociability in public', 'A score of 100 is for someone who is always open-minded in family, work and social gatherings and behaves in such a way that others do not feel strange towards him.'),
(198, 3, 67, 'گشاده رویی و خوش مشربی در جمع', 'نمره 100 برای کسی است که در جمع های خانوادگی و کاری و اجتماعی معمولا همیشه گشاده رو و طوری رفتار میکند که دیگران با او احساس غریبه گی ندارند.(خوش رویی)\n', 'گشاده رویی و خوش مشربی در جمع', 'نمره 100 برای کسی است که در جمع های خانوادگی و کاری و اجتماعی معمولا همیشه گشاده رو و طوری رفتار میکند که دیگران با او احساس غریبه گی ندارند.(خوش رویی)'),
(199, 1, 68, NULL, NULL, 'Поиск славы и славы для себя', 'Оценка 100 для того, кто очень заинтересован в поиске славы для себя, например, если он в команде, он ищет славы для себя больше, чем заботится о славе своей команды.'),
(200, 2, 68, ' -Seeking fame', 'the score of 100 is for someone who is very interested in seeking fame for him/herself, for example, if he/she is in a team, she seeks fame for him/herself more than she cares about the fame of his/her team. ', 'Seeking fame and fame for yourself', 'A score of 100 is for someone who is very interested in seeking fame for himself, for example, if he is in a team, he seeks fame for himself more than he cares about the fame of his team.'),
(201, 3, 68, 'نامجوئی و شهرت طلبی برای خویشتن', 'نمره 100 برای کسی است که علاقه وافری به شهرت طلبی برای شخص خود دارد مثلا اگر در یک تیم باشد بیش از آنکه به فکر شهرت تیمش باشد برای خودش شهرت طلب میکند.', 'نامجوئی و شهرت طلبی برای خویشتن', 'نمره 100 برای کسی است که علاقه وافری به شهرت طلبی برای شخص خود دارد مثلا اگر در یک تیم باشد بیش از آنکه به فکر شهرت تیمش باشد برای خودش شهرت طلب میکند.'),
(202, 1, 69, NULL, NULL, 'Ажиотаж в обществе', '100 баллов – это тот, кто воспитан и жив в обществе, готов к коллективной работе, занят и счастлив в кабинетах, и его присутствие ощущается полностью, а его отсутствие все замечают.'),
(203, 2, 69, ' -Excitement in the community', 'the score of 100 is for someone who is well-mannered and lively in the community and ready for collective work, and is busy and happy at work, also his/her presence is felt by others and everyone notices  their absence. ', 'Excitement in the community', 'A score of 100 is for someone who is well-mannered and lively in the community and is ready to do collective work, and is busy and happy in the offices, and his presence is felt completely and everyone notices his absence.'),
(204, 3, 69, 'نشاط در اجتماع', 'نمره 100 برای کسی است که در اجتماع خوش اخلاق و پر جنب و جوش و آماده کارهای دسته جمعی  است و رد ادارات هم پر کار و شاد است و حضورش کاملا احساس میشود و همه متوجه غیبتش هم میشوند.', 'نشاط در اجتماع', 'نمره 100 برای کسی است که در اجتماع خوش اخلاق و پر جنب و جوش و آماده کارهای دسته جمعی  است و رد ادارات هم پر کار و شاد است و حضورش کاملا احساس میشود و همه متوجه غیبتش هم میشوند.'),
(205, 1, 70, NULL, NULL, 'Волнение на работе', '100 баллов – это человек, который своим поведением на работе и условиями труда приносит радость окружающим, а дома этого может не быть.'),
(206, 2, 70, ' Joy at work', 'the score of 100 is for a person who brings joy to others with their behavior at work while this may not be like that at home. ', 'Excitement at work', 'A score of 100 is for a person who brings joy to others with his behavior at work and in his work conditions, while this may not be the case at home.'),
(207, 3, 70, 'نشاط در کار', 'نمره 100 برای کسی است که در محل کار و شرایط شغلی با رفتارش در دیگران نشاط ایجاد میکند و این در حالیستکه در منزل ممکن است اینطور نباشد.\n', 'نشاط در کار', 'نمره 100 برای کسی است که در محل کار و شرایط شغلی با رفتارش در دیگران نشاط ایجاد میکند و این در حالیستکه در منزل ممکن است اینطور نباشد.'),
(208, 1, 71, NULL, NULL, 'Постановка долгосрочных целей', '100 баллов — это тот, кто ставит цели как минимум на ближайшие десять лет (цели не принимаются во внимание, поскольку они являются общей функцией неличных дел), и их следует учитывать в личной жизни. много времени'),
(209, 3, 71, 'هدف گزاری بلند مدت', 'نمره 100 برای کسی است که برای حداقل با لای ده سال بعد هدف گزاری میکند ( هدف گزاری برای کارهای بیزنسی چون تابع کلی موارد غیر شخصیتی. هستند مد نظر نمیباشد )و باید در موارد زندگی شخصی انرا در نظر گرفت .دور اندیشی و تعیین اهداف بلند مدت', 'هدف گذاری بلند مدت', 'نمره 100 برای کسی است که برای حداقل با لای ده سال بعد هدف گزاری میکند ( هدف گزاری برای کارهای بیزنسی چون تابع کلی موارد غیر شخصیتی. هستند مد نظر نمیباشد )و باید در موارد زندگی شخصی انرا در نظر گرفت .دور اندیشی و تعیین اهداف بلند مدت'),
