(218, 3, 74, 'میل به طلا و جواهرات', NULL, 'میل به طلا و جواهرات', ''),
(219, 1, 75, NULL, NULL, 'Возможность быть застенчивым', '100 баллов - для тех, кто не чувствует себя комфортно в присутствии других и в некоторых случаях (в любом возрасте) краснеет при разговоре с людьми, которые им не близки.'),
(220, 2, 75, ' -The potential to be shy', 'the score of 100 is for someone who does not feel comfortable being in the presence of others and in some cases (at any age) they blush when talking to people who are not close to them. ', 'The potential to be shy', 'A score of 100 is for someone who does not feel comfortable being in the presence of others and in some cases (at any age) they blush when talking to people who are not close to them.'),
(221, 3, 75, 'پتانسیل خجالتی بودن', 'نمره 100 برای کسی است که از حضور در نزد دیگران احساس آرامش ندارد و در برخی موارد (در هر سنی) هم در هنگام صحبت با افراد غیر نزدیک دچار سرخی رو میشوند.', 'پتانسیل خجالتی بودن', 'نمره 100 برای کسی است که از حضور در نزد دیگران احساس آرامش ندارد و در برخی موارد (در هر سنی) هم در هنگام صحبت با افراد غیر نزدیک دچار سرخی رو میشوند.'),
(222, 1, 76, NULL, NULL, 'Выслушивание мелких проблем супруга', '100 баллов – это для того, кто тратит столько же времени и эмоций на выслушивание простой головной боли своей жены, чем на большую проблему.'),
(223, 2, 76, ' -Listening to the spouse\'s minor problems', 'the score of 100 is for someone who spends as much time and energy listening to a simple headache of his/her spouse as a major problem. ', 'Listening to the spouse\'s minor problems', 'A score of 100 is for someone who spends as much time and emotions listening to a simple headache of his wife than a big problem.'),
(224, 3, 76, 'گوش فرا دادن به مشکلات جزئی همسر', 'نمره 100 برای کسی است که از گوش دادن به یک سردرد ساده همسرش هم همان قدر زمان و احساسات خرج میکند تا یک مشکل بزرگ.', 'گوش فرا دادن به مشکلات جزئی همسر', 'نمره 100 برای کسی است که از گوش دادن به یک سردرد ساده همسرش هم همان قدر زمان و احساسات خرج میکند تا یک مشکل بزرگ.'),
(225, 1, 77, '   Гибкость', NULL, 'гибкость', 'Оценка 100 для того, кто приспосабливается к ситуации в любой ситуации, и это чаще всего происходит на практике, даже если он ворчит на языке. Например, в суровых условиях окружающей среды.'),
(226, 2, 77, '  Flexibility', 'the score of 100 is for someone who adapts to any situation and this mostly happens in practice even though he grumbles in speech. Like being in harsh environmental conditions.  ', 'flexibility', 'A score of 100 is for someone who adapts to the situation in any situation and this mostly happens in practice even though he grumbles in the language. Like being in harsh environmental conditions.'),
(227, 3, 77, 'انعطاف پذیری', 'نمره 100 برای کسی است که در هر حالتی  خود را با شرایط تطبیق میدهد و این بیشتر در عمل اتفاق میافتد با اینکه در زبان غر بزند. مثل قرار گرفتن در شرایط سخت محیطی .', 'انعطاف پذیری', 'نمره 100 برای کسی است که در هر حالتی  خود را با شرایط تطبیق میدهد و این بیشتر در عمل اتفاق میافتد با اینکه در زبان غر بزند. مثل قرار گرفتن در شرایط سخت محیطی .'),
(228, 1, 78, NULL, NULL, 'Потенциал отклонения от основной темы в переговорах и беседах', 'Оценка 100 для того, кто использует много тем, не связанных с основной темой переговоров в ежедневных разговорах (склонность к чепухе).'),
(229, 2, 78, ' -The potential to deviate from the main topic in  conversations', 'the score of 100 is for someone who uses a lot of topics unrelated to the main topic in daily conversations (tendency to talk nonsense). ', 'The potential to deviate from the main topic in negotiations and conversations', 'A score of 100 is for someone who uses a lot of topics unrelated to the main topic of negotiation in daily conversations (tendency to talk nonsense).'),
(230, 3, 78, 'پتانسیل انحراف از موضوع اصلی در مذاکرات و محاوره', 'نمره 100 برای کسی است که در محاوره و گفتگو های روز مره از موضوعات نامرتبط به موضوع اصلی مذاکره زیاد بهره میبرد (گرایش به بیهوده گویی). ', 'پتانسیل انحراف از موضوع اصلی در مذاکرات و محاوره', 'نمره 100 برای کسی است که در محاوره و گفتگو های روز مره از موضوعات نامرتبط به موضوع اصلی مذاکره زیاد بهره میبرد (گرایش به بیهوده گویی).'),
(231, 1, 79, NULL, NULL, 'Потенциал универсальности', '100 баллов присваивается тому, кто приспосабливается к условиям этого места различными способами, например, меняет город, школу или страну, и действует меньше по сравнению с предыдущими отношениями, например, меняет одежду, пищу, язык, и т.д.)'),
(232, 2, 79, ' -Potential of adaptation', 'the score of 100 is for a person who easily adapts him/herself to the conditions of new place in a wide range, such as changing the city, school, or country, and is welcoming to new relationships, clothes, food, language, etc. ', 'Versatility potential', 'A score of 100 is for someone who adapts to the conditions of that place in a wide range of ways, such as changing the city, school, or country, and acts less compared to previous relationships, such as changing clothes, food, language, etc. )'),
(233, 3, 79, 'پتانسیل تطبیق پذیری', 'نمره 100 برای کسی است که در ابعاد گسترده مثل عوض کردن شهر و یا مدرسه و یا کشور خود را با شرایط آن محل تطبیق داده و نسبت به تعلقات قبلی کم رنگ عمل میکند .مثل تغییر لباس و خوراک و زبان و ...(سازگاری)', 'پتانسیل تطبیق پذیری', 'نمره 100 برای کسی است که در ابعاد گسترده مثل عوض کردن شهر و یا مدرسه و یا کشور خود را با شرایط آن محل تطبیق داده و نسبت به تعلقات قبلی کم رنگ عمل میکند .مثل تغییر لباس و خوراک و زبان و ...(سازگاری)'),
(234, 1, 80, NULL, NULL, 'Взаимодействие с менеджером', '100 баллов присуждается тому, кто лучше всех взаимодействует со своими руководителями в различных ситуациях.'),
(235, 2, 80, ' Interact with the manager', 'the score of 100 is for someone who can have the best interaction with their managers in different situations. ', 'Interaction with the manager', 'A score of 100 is for someone who can have the best interaction with their managers in different situations.'),
(236, 3, 80, 'تعامل با مدیر', 'نمره 100 برای کسی است که در شرایط مختلف بهترین تعامل را میتواند با مدیران خود داشته باشد.\n', 'تعامل با مدیر', 'نمره 100 برای کسی است که در شرایط مختلف بهترین تعامل را میتواند با مدیران خود داشته باشد.'),
(237, 1, 81, NULL, NULL, 'Преувеличение и преувеличение в восхвалении других', '100 баллов — это человек, который в нормальных условиях пытается привлечь их внимание, делая им комплименты в присутствии старших, чиновников и даже друзей, и обычно ведет себя эмоционально и преувеличенно.'),
(238, 2, 81, ' -Exaggeration in praise of others', 'A score of 100 is for a person who tries to attract others’ opinions by complimenting them in the presence of elders, officials, and even friends, and usually behaves extremely emotional and exaggerated. ', 'Exaggeration and exaggeration in praise of others', 'A score of 100 is for a person who, under normal circumstances, tries to attract their opinion by complimenting them in the presence of elders, officials, and even friends, and usually behaves in emotional and exaggerated definitions.'),
(239, 3, 81, 'مبالغه و اغراق در تعریف از دیگران\n', 'نمره 100 برای کسی است که در شرایط معمولی در نزد بزرگان و مقامات و حتی دوستان سعی در جذب نظر آنها با تعریف و تمجید از انان را دارد و معمولا در تعاریف احساسی و اغراق امیز رفتار میکند.\n', 'مبالغه و اغراق در تعریف از دیگران', 'نمره 100 برای کسی است که در شرایط معمولی در نزد بزرگان و مقامات و حتی دوستان سعی در جذب نظر آنها با تعریف و تمجید از انان را دارد و معمولا در تعاریف احساسی و اغراق امیز رفتار میکند.'),
