(243, 1, 83, ' Потребность во внимании', NULL, 'поиск внимания', '100 баллов – это ребенок, который пытается направить на себя взгляды и мысли других людей с помощью различных действий.'),
(244, 2, 83, '  -attention seeking', 'the score of 100 is for a child who tries to direct others\' eyes and minds towards him with different behaviors.  ', 'attention seeking', 'A score of 100 is for a child who tries to direct others\' eyes and minds towards him with different behaviors.'),
(245, 3, 83, 'تمایل به توجه طلبی (جلب توجه)', 'نمره 100 برای کودکی است که با رفتارهای متفاوت سعی در سوق دادن نگاه و ذهن دیگران به سمت خود دارد.', 'تمایل به توجه طلبی (جلب توجه)', 'نمره 100 برای کودکی است که با رفتارهای متفاوت سعی در سوق دادن نگاه و ذهن دیگران به سمت خود دارد.'),
(246, 1, 84, NULL, NULL, 'В определенные времена, выдавая человеческое достоинство за маленькие и большие интересы', ''),
(247, 2, 84, '-', NULL, 'At certain times, passing human dignity for small and big interests', ''),
(248, 3, 84, 'در زمان های  خاص از عزت انسانی بخاطر منافع کوچک و بزرگ گذشتن', NULL, 'در زمان های  خاص از عزت انسانی بخاطر منافع کوچک و بزرگ گذشتن', ''),
(249, 1, 85, ' Милосердие и сострадание', NULL, 'милосердие и сострадание', '100 баллов – тому, чья жалость и сострадание охватывают все и всех, и он скорбит о сломанной ветке, даже когда дело доходит до того, чтобы видеть, как людям больно, а его милосердие иногда даже мешает правосудию.'),
(250, 2, 85, '  Mercy and Compassion ', 'The score of 100 is for someone whose compassion includes everything and everyone, and he/she grieves over the breaking of a branch and his/her mercy sometimes even hinders justice.  ', 'mercy and compassion', 'A score of 100 is for someone whose pity and compassion includes everything and everyone, and he grieves over the breaking of a branch, even when it comes to seeing people hurt. And his mercy sometimes even hinders justice.'),
(251, 3, 85, 'رحم و دلسوزی', 'نمره 100 برای کسی است که ترحم و دلسوزی او شامل همه چیز و همه کس میشود و از شکستن یک شاخه هم غصه میخورد تا چه رسد به اسیب دیدن انسانها.و رحم او حتی گاهی مانع عدالت هم میشود.', 'رحم و دلسوزی', 'نمره 100 برای کسی است که ترحم و دلسوزی او شامل همه چیز و همه کس میشود و از شکستن یک شاخه هم غصه میخورد تا چه رسد به اسیب دیدن انسانها.و رحم او حتی گاهی مانع عدالت هم میشود.'),
(252, 1, 86, NULL, NULL, 'Возможность любить врожденно', '100 баллов – это для того, кто любит свою профессию, комментирует и выражает чувства ко всему, от еды и деревьев до людей и животных, с некоторым романтическим энтузиазмом. Обычно такие люди рано плачут.'),
(253, 2, 86, ' The potential to love innately', 'the score of 100 is for someone who is a real lover and expresses feelings and emotions about almost everything, from foods and trees to humans and animals with a kind of romantic enthusiasm. Usually these people cry soon. ', 'The potential to love innately', 'A score of 100 is for someone who loves his profession and comments and expresses feelings about everything from food and trees to humans and animals with a kind of romantic enthusiasm. Usually these people cry early.'),
(254, 3, 86, 'پتانسیل عشق ورزیدن ذاتی', 'نمره 100 برای کسی است که عاشق پیشه است و نسبت به همه چیز از غذا و درخت گرفته تا انسان و حیوان با نوعی شوق عاشقانه اظهار نظر و ابراز  احساسات میکند . معمولا این افراد زود گریه میکنند.', 'پتانسیل عشق ورزیدن ذاتی', 'نمره 100 برای کسی است که عاشق پیشه است و نسبت به همه چیز از غذا و درخت گرفته تا انسان و حیوان با نوعی شوق عاشقانه اظهار نظر و ابراز  احساسات میکند . معمولا این افراد زود گریه میکنند.'),
(255, 1, 87, NULL, NULL, 'сочувствие', '100 баллов – это тот, кто всегда находится с друзьями, родственниками и знакомыми в грустные дни и всегда находится в первом ряду на таких встречах или мероприятиях.'),
(256, 2, 87, 'Sympathy', 'A score of 100 is for someone who always takes care of friends, relatives, and acquaintances on bad days and is always eager to help them in such meetings or events.', 'Sympathy', 'A score of 100 is for someone who is always with friends, relatives, and acquaintances on sad days and is always in the first row in such meetings or events.'),
