(323, 1, 110, NULL, NULL, 'Имеет связь с матерью, когда она счастлива', '100 баллов соответствует ребенку, который более готов объясняться с матерью или общаться с ней, когда он счастлив.'),
(324, 2, 110, ' -Communication with mother during happiness', 'the score of 100 is for a child who is more willing to explain to or communicate with his mother when he is happy. ', 'It has a connection with the mother when she is happy', 'A score of 100 is for a child who is more willing to explain to his mother or communicate with his mother when he is happy.'),
(325, 3, 110, 'ارتباط با مادر در هنگام شادی دارد', 'نمره 100 برای کودکی است که در زمان شادی شدن تمایل بیشتری در توضیح برای مادر و یا برقراری ارتباط با مادر را دارد .\n', 'ارتباط با مادر در هنگام شادی دارد', 'نمره 100 برای کودکی است که در زمان شادی شدن تمایل بیشتری در توضیح برای مادر و یا برقراری ارتباط با مادر را دارد .'),
(326, 1, 111, NULL, NULL, 'Склонность оскорблять других в эмоциональных ситуациях', 'Оценка 100 – тому, у кого в повседневных разговорах, особенно в разговорах, обычно во всех предложениях скрыто какое-то оскорбление, даже если оно не грубое.'),
(327, 2, 111, 'Tendency to insult others in emotional situations', 'the score of 100 is for someone who usually has some kind of insult hidden in all his/her sentences, even if it is not rude, especially in daily conversations. ', 'Tendency to insult others in emotional situations', 'A score of 100 is for someone who in daily conversations, especially in conversations, usually has some kind of insult hidden in all his sentences, even if it is not rude.'),
(328, 3, 111, 'گرایش به توهین کردن به دیگران در شرایط احساسی', 'نمره 100 برای کسی است که در محاوره های روز مره بخصوص در محاورات معمولا در تمام جملاتش حتی اگر بی ادبانه هم نباشد نوعی توهین نهفته است.\n', 'گرایش به توهین کردن به دیگران در شرایط احساسی', 'نمره 100 برای کسی است که در محاوره های روز مره بخصوص در محاورات معمولا در تمام جملاتش حتی اگر بی ادبانه هم نباشد نوعی توهین نهفته است.'),
(329, 1, 112, NULL, NULL, 'Быть эффективным, поощряться, принимать, слушать, оставаться в уме, проводить время с матерью', '100 баллов — это ребенок, который, выполняя хорошую работу, больше впечатлен, если вы поощрите его обещанием пойти куда-нибудь с матерью.'),
(330, 2, 112, ' -Being effective, being encouraged, accepting, listening, staying in the mind, from hanging out with mother', 'the score of 100 is for a child who is more impressed if you encourage him with a reward of a promise to go out with his mother.(when doing a good work) ', 'Being effective, being encouraged, accepting, listening, staying in the mind, from hanging out with mother', 'A score of 100 is for a child who, when doing good work, is more impressed if you encourage him with a reward of a promise to go out with his mother.'),
(331, 3, 112, 'موثر بودن ، تشویق شدن ،پذیرفتن،حرف شنوی،ماندگاری در ذهن،از گردش با مادر', 'نمره 100 برای کودکی است که در هنگام انجام کارهای خوب چنانچه با جایزه یک قول بیرون رفتن با مادر او را تشویق کنید بیشتر تحت تاثیر قرار میدهد.\n', 'موثر بودن ، تشویق شدن ،پذیرفتن،حرف شنوی،ماندگاری در ذهن،از گردش با مادر', 'نمره 100 برای کودکی است که در هنگام انجام کارهای خوب چنانچه با جایزه یک قول بیرون رفتن با مادر او را تشویق کنید بیشتر تحت تاثیر قرار میدهد.'),
