(334, 3, 113, 'احتمال مراجعه بعدی بدون موفقیت', NULL, 'احتمال مراجعه بعدی بدون موفقیت', ''),
(335, 1, 114, NULL, NULL, 'Возможность привлечения к рекламе с четырьмя повторами', 'Оценка 100 для того, кто, если мы разделим всех людей сообщества на четыре группы, которые находятся под влиянием рекламы и приводят к своим действиям по теме этой рекламы, этот человек будет в четвертой группе.'),
(336, 2, 114, ' -The possibility of being attracted to an advertisement, with four repetitions', 'if we divide all the people of a community into four groups, who are influenced by an advertisement and lead to their action on the subject of that advertisement, A score of 100 is for someone who will be in the fourth group.', 'The possibility of being attracted to an advertisement, with four repetitions', 'A score of 100 is for someone who, if we divide all the people of a community into four groups, who are influenced by an advertisement and lead to their action on the subject of that advertisement, this person will be in the fourth group.'),
(337, 3, 114, 'امکان جذب به یک تبلیغ ،با چهار بار تکرار', 'نمره 100 برای کسی است که اگر کل افراد یک اجتماع را  به چهار گروه تقسیم کنیم که تحت تاثیر یک تبلیغ قرار بگیرند و منجر به اقدام انها در موضوع آن تبلیغ شود  این فرد جزو چهارمین گروه خواهد بود.', 'امکان جذب به یک تبلیغ ،با چهار بار تکرار', 'نمره 100 برای کسی است که اگر کل افراد یک اجتماع را  به چهار گروه تقسیم کنیم که تحت تاثیر یک تبلیغ قرار بگیرند و منجر به اقدام انها در موضوع آن تبلیغ شود  این فرد جزو چهارمین گروه خواهد بود.'),
