(342, 2, 116, ' -Potential to be disturbed by life crises', 'the score of 100 is for someone who has a talent for mental breakdown with small issues. ', 'Potential to be disturbed by life crises', 'A score of 100 is for someone who has a talent for mental distress with small issues.'),
(343, 3, 116, 'پتانسیل آشفته شدن از بحران های زندگی', 'نمره 100 برای کسی است که با موضوعات کوچک به سمت پریشانی روان استعداد دارند .', 'پتانسیل آشفته شدن از بحران های زندگی', 'نمره 100 برای کسی است که با موضوعات کوچک به سمت پریشانی روان استعداد دارند .'),
(344, 1, 117, ' Самоуничижение', NULL, 'самоуничижение', 'Недооценка (недооценка себя) (понижение себя в повседневном общении ради различных уловок, не обязательно этичных)'),
(345, 2, 117, '  -Underestimation', 'self humiliation(Decreasing one\'s limits in daily communication, due to various reasons that are not necessarily ethical)  ', 'self humiliation', 'Underestimation (underestimating oneself) (lowering oneself in daily communication for various expedients that are not necessarily ethical)'),
(346, 3, 117, 'تحقیر خود', 'کم پنداری(دست کم گرفتن خود)(از اندازه خود پایین آمدن در ارتباطات روز مره بنا به مصلحت های مختلف که الزاما اخلاقی نیستند)', 'تحقیر خود', 'کم پنداری(دست کم گرفتن خود)(از اندازه خود پایین آمدن در ارتباطات روز مره بنا به مصلحت های مختلف که الزاما اخلاقی نیستند)'),
(347, 1, 119, NULL, NULL, 'Склонность к самоуничижению в общении', '100 баллов для того, кто всегда считает себя меньшим, чем другие, с точки зрения того, что у него есть.'),
(348, 2, 119, ' Self-deprecating', 'the score of 100 is for someone who always sees himself as lower than others in terms of what he has. ', 'Tendency to self-deprecation in communication', 'A score of 100 is for someone who always sees himself as less than others in terms of what he has.'),
(349, 3, 119, 'گرایش به خود کم بینی در ارتباطات', 'نمره 100 برای کسی است که همیشه نسبت به داشته های خود در مقایسه با دیگران خود را کمتر میبیند .', 'گرایش به خود کم بینی در ارتباطات', 'نمره 100 برای کسی است که همیشه نسبت به داشته های خود در مقایسه با دیگران خود را کمتر میبیند .'),
(350, 1, 120, NULL, NULL, 'Скорость запутывания в одной и той же ситуации по сравнению с другими', '100 баллов – для человека, который проявляет гнев и нестабильность в своем повседневном поведении и проявляет дискомфорт без ясной причины.'),
(351, 2, 120, ' Getting confused', 'the score of 100 is for someone who has a kind of anger and instability in his daily behavior and shows discomfort for which there is no clear reason. ', 'The speed of getting confused in the same situation compared to others', 'A score of 100 is for someone who has a kind of anger and instability in his daily behavior and shows discomfort for which there is no clear reason.'),
(352, 3, 120, 'سرعت کلافه شدن در شرایطی یکسان نسبت به دیگران', 'نمره 100 برای کسی است که در رفتارهای روزانه اش نوعی عصبانیت و عدم ثبات نهفته است و ناراحتی هایی را از خود بروز میدهد که دلیل واضحی برای آن ندارد.\n', 'سرعت کلافه شدن در شرایطی یکسان نسبت به دیگران', 'نمره 100 برای کسی است که در رفتارهای روزانه اش نوعی عصبانیت و عدم ثبات نهفته است و ناراحتی هایی را از خود بروز میدهد که دلیل واضحی برای آن ندارد.'),
(353, 1, 121, NULL, NULL, 'Зависимость от других', 'Оценка 100 для того, кто всегда думает, что должен быть кто-то, на кого можно положиться или побудить его сделать что-то, и он предпочитает, чтобы за ним следовали даже в простых вещах.'),
(354, 2, 121, ' Relying on others', 'the score of 100 is for someone who always thinks that there should be someone to rely on or encourage him to do something, and his preference is  to be followed by others even in doing simple things. ', 'Being dependent on others', 'A score of 100 is for someone who always thinks that there should be someone to rely on or encourage him to do something, and his preference is that he is followed even in doing simple things.'),
(355, 3, 121, 'متکی بودن به دیگران', 'نمره 100 برای کسی است که همیشه فکر میکند باید یک نفر باشد تا با تکیه و یا دلگرمی به او کاری را انجام دهد و ترجیح او اینست که حتی در انجام مسائل ساده هم بدنبال همراه میگردد.', 'متکی بودن به دیگران', 'نمره 100 برای کسی است که همیشه فکر میکند باید یک نفر باشد تا با تکیه و یا دلگرمی به او کاری را انجام دهد و ترجیح او اینست که حتی در انجام مسائل ساده هم بدنبال همراه میگردد.'),
(356, 1, 122, NULL, NULL, 'Постоянное чувство неуверенности в отверженности и одиночестве', '100 баллов – для того, кто постоянно находится в состоянии страха и опасения, что он будет разлучен со своими близкими из-за человеческого фактора, событий или смерти.'),
(357, 2, 122, ' -Constant feeling of insecurity of rejection and being alone', 'the score of 100 is for someone who is constantly in a state of fear of separation from his/her loved ones due to human factors or events or death. ', 'Constant feeling of insecurity of rejection and being alone', 'A score of 100 is for someone who is constantly in a state of fear and apprehension that he will be separated from his loved ones due to human factors or events or death.'),
(358, 3, 122, 'احساس نا امنی مداوم از طرد شدن و تنها ماندن', 'نمره 100 برای کسی است که مدام در حالتی از ترس و دلهره است که بواسطه های انسانی و یا اتفاقات  و یا مرگ از کسانی که دوستشان دارد جدا بیفتد.', 'احساس نا امنی مداوم از طرد شدن و تنها ماندن', 'نمره 100 برای کسی است که مدام در حالتی از ترس و دلهره است که بواسطه های انسانی و یا اتفاقات  و یا مرگ از کسانی که دوستشان دارد جدا بیفتد.'),
(359, 1, 123, NULL, NULL, 'Преувеличение беспокойства и опасений при равных обстоятельствах по сравнению с другими', '100 баллов – тому, кто в равных с другими условиях проявляет столько страха и беспокойства, что это вызывает дискомфорт у окружающих.'),
(360, 2, 123, ' -Having exaggerated worry and apprehension in equal situation compared to others', 'the score of 100 is for someone who shows so much fear and concern which causes discomfort to others.(in equal conditions with others) ', 'Having exaggerated worry and apprehension in equal circumstances compared to others', 'A score of 100 is for someone who, in equal conditions with others, shows so much fear and concern that it causes discomfort to others.'),
(361, 3, 123, 'داشتن نگرانی و دلهره اغراق آمیز در شرایط مساوی در مقایسه با دیگران', 'نمره 100 برای کسی است که در شرایط مساوی با دیگران چنان از خود دلهره و نگرانی نشان میدهد که باعث ناراحتی دیگران میشود.', 'داشتن نگرانی و دلهره اغراق آمیز در شرایط مساوی در مقایسه با دیگران', 'نمره 100 برای کسی است که در شرایط مساوی با دیگران چنان از خود دلهره و نگرانی نشان میدهد که باعث ناراحتی دیگران میشود.'),
(362, 1, 124, NULL, NULL, 'иметь трюк', '100 баллов – для человека, который не проявляет прозрачности в своем повседневном поведении на работе и в обществе и обычно использует необычные и неэтичные способы для достижения своих целей. На самом деле, для них цель оправдывает средства.'),
(363, 2, 124, ' -to play a trick', 'the score of 100 is for a person who does not show transparency in his daily behavior at work  or society and usually uses unusual and unethical ways to achieve his goals. In fact, for them, the goal justifies the means. ', 'to have a trick', 'A score of 100 is for a person who does not show transparency in his daily behavior in work and society and usually uses unusual and unethical ways to achieve his goals. In fact, for them, the goal justifies the means.'),
(364, 3, 124, 'نیرنگ داشتن', 'نمره 100 برای کسی است که در رفتارهای روزمره خود بویزه در کار و اجتماع شفافیت به خرج نداده و معمولا در رسیدن به اهداف از راههای غیر معمول و غیر اخلاقی نیز بهره میبرد . در واقع برای ایشان هدف وسیله را توجیه میکند.\n', 'نیرنگ داشتن', 'نمره 100 برای کسی است که در رفتارهای روزمره خود بویزه در کار و اجتماع شفافیت به خرج نداده و معمولا در رسیدن به اهداف از راههای غیر معمول و غیر اخلاقی نیز بهره میبرد . در واقع برای ایشان هدف وسیله را توجیه میکند.'),
(365, 1, 125, NULL, NULL, 'Склонность к жадности', ''),
