(367, 3, 125, 'گرایش به گسی', NULL, 'گرایش به گسی', ''),
(368, 3, 126, 'سرحالی صبحگاهی (تمایل به خواب صبح ندارد حتی اگر اجباری نداشته باشد)', 'نمره 100 برای کسی است که بیشترین انرژی روز را در ساعت صبح داشته و این ربطی به صبح زود بلند شدن فرد ندارد . و فرد هر زمانی که از خواب بلند شده بعد از صرف صبحانه اماده هر فعالیتی چه بدنی و چه فکری است. ', 'سرحالی صبحگاهی (تمایل به خواب صبح ندارد حتی اگر اجباری نداشته باشد)', 'نمره 100 برای کسی است که بیشترین انرژی روز را در ساعت صبح داشته و این ربطی به صبح زود بلند شدن فرد ندارد . و فرد هر زمانی که از خواب بلند شده بعد از صرف صبحانه اماده هر فعالیتی چه بدنی و چه فکری است.'),
(369, 1, 127, NULL, NULL, 'Уязвимость к сравнениям внешности', '100 баллов – это ребенок, который, если сравнивать его внешний вид с другими детьми, например, рост или вес, на долгое время впадает в депрессию и тревогу.'),
(370, 2, 127, ' -Vulnerability to appearance comparisons', 'A score of 100 is for a child who becomes depressed and anxious for a long time, if you compare his/her appearance with other children, such as height or weight. ', 'Vulnerability to appearance comparisons', 'A score of 100 is for a child who, if you compare his appearance with other children, such as height or weight, becomes depressed and anxious for a long time.'),
(371, 3, 127, 'آسیب پذیری از مقایسه ظاهری', 'نمره 100 برای کودکی است که چنانچه ظاهر او را با کودکان دیگر مقایسه کنید ،مثلا قد و یا وزن ،تا مدتها در خود فرو رفته و افسرده و نگران و مضطرب میشود.', 'آسیب پذیری از مقایسه ظاهری', 'نمره 100 برای کودکی است که چنانچه ظاهر او را با کودکان دیگر مقایسه کنید ،مثلا قد و یا وزن ،تا مدتها در خود فرو رفته و افسرده و نگران و مضطرب میشود.'),
(372, 1, 128, NULL, NULL, 'Сохранение негативных точек в сознании', '100 баллов для того, кто никогда не стирает негативные моменты из своей памяти, никогда не забывает оскорбление или рану с чьего-то языка.'),
(373, 2, 128, 'Persistence of negative points in the mind', 'the score of 100 is for someone who never erases negative points from his mind. This person never forgets an insult or  acrimony. ', 'Persistence of negative points in the mind', 'A score of 100 is for someone who never erases negative points from his mind. This person never forgets an insult or a wound from someone\'s tongue.'),
(374, 3, 128, 'ماندگاری نکات منفی در ذهن', 'نمره 100 برای کسی است که هیچگاه نکات منفی از ذهنش پاک نمیشود.این فرد هرگز توهین و یا زخم زبان یک نفر را فراموش نمیکند.', 'ماندگاری نکات منفی در ذهن', 'نمره 100 برای کسی است که هیچگاه نکات منفی از ذهنش پاک نمیشود.این فرد هرگز توهین و یا زخم زبان یک نفر را فراموش نمیکند.'),
(375, 1, 129, NULL, NULL, 'Общение с отцом, когда злится на других', '100 баллов соответствует ребенку, который может общаться со своим отцом только тогда, когда тот злится.'),
(376, 2, 129, ' -Communication with father when angry with others', 'A score of 100 is for a child who can only communicate with his father when he is angry. ', 'Communication with father when angry with others', 'A score of 100 is for a child who can only communicate with his father when he is angry.');
INSERT INTO `item_title` (`id`, `languageID`, `itemID`, `title`, `description`, `title_temp`, `description_temp`) VALUES
