(614, 3, 209, 'مدیریت عواطف', 'نمره 100 برای کسی است که توانایی در ابراز عشق ،ابراز تنفر عاطفی،بخشش، و موارد مشابه در زمان های غیر ضروری و در هنگام فوران جلوی خود را بگیرد و آن را به تعدیل در آورد', 'مدیریت عواطف', 'نمره 100 برای کسی است که توانایی در ابراز عشق ،ابراز تنفر عاطفی،بخشش، و موارد مشابه در زمان های غیر ضروری و در هنگام فوران جلوی خود را بگیرد و آن را به تعدیل در آورد'),
