(702, 1, 242, NULL, NULL, 'Чувствительность в выполнении задач', '100 баллов – для того, кто считает поставленные задачи важными и старается выполнять их с высокой чуткостью и концентрацией, без колебаний и с минимальными изменениями.'),
(703, 2, 242, ' Conscientiousness', 'the score of 100 is for someone who considers the assigned tasks important and tries to complete them with high sensitivity and concentration, without hesitation. ', 'Sensitivity in performing tasks', 'A score of 100 is for someone who considers the assigned tasks important and tries to complete them with high sensitivity and concentration, without hesitation and minimal changes.'),
(704, 3, 242, 'حساسیت در انجام وظایف', 'نمره 100 برای کسی است که  وظایف محوله را مهم تلقی کرده و سعی میکند که با حساسیت و تمرکز بالا ، بدون غل و غش و کمترین تغییرات آن را تا انتها به انجام برساند.', 'حساسیت در انجام وظایف', 'نمره 100 برای کسی است که  وظایف محوله را مهم تلقی کرده و سعی میکند که با حساسیت و تمرکز بالا ، بدون غل و غش و کمترین تغییرات آن را تا انتها به انجام برساند.'),
(705, 1, 243, NULL, NULL, 'Правило полового влечения над повседневным поведением', ''),
(706, 2, 243, '-', NULL, 'The rule of sexual desire over daily behavior', ''),
(707, 3, 243, 'حاکمیت شهوت جنسی بر رفتارهای روز مره', NULL, 'حاکمیت شهوت جنسی بر رفتارهای روز مره', '');
INSERT INTO `item_title` (`id`, `languageID`, `itemID`, `title`, `description`, `title_temp`, `description_temp`) VALUES
(708, 1, 244, NULL, NULL, 'Эмоциональная привязанность', 'Лояльность к тому, с кем он имеет эмоциональную связь и взял на себя обязательства в этом отношении. (Не относится к официальным случаям, таким как брак)'),
(709, 2, 244, ' -Emotional attachment', 'Loyalty to someone with whom he has an emotional connection and has accepted obligations in this regard. (Does not apply to official cases such as marriage) ', 'Emotional attachment', 'Loyalty to someone with whom he has an emotional connection and has accepted obligations in this regard. (Does not apply to official cases such as marriage)'),
(710, 3, 244, 'پایبندی عاطفی', 'وفاداری به کسی که با او ارتباط عاطفی دارد و در این باره تعهداتی را بر ضمه خود قبول کرده است. (در موارد رسمی همچون ازدواج صدق نمی کند)', 'پایبندی عاطفی', 'وفاداری به کسی که با او ارتباط عاطفی دارد و در این باره تعهداتی را بر ضمه خود قبول کرده است. (در موارد رسمی همچون ازدواج صدق نمی کند)'),
(711, 1, 245, NULL, NULL, 'Соблюдение финансовых законов и соглашений (не вмешивайтесь в финансовые дела, в которых вам даны полномочия, для собственной выгоды и выгоды других)', 'Внимательность и тщательное выполнение планов и графиков, согласованных с организацией или другим лицом в финансовых вопросах.'),
(712, 2, 245, 'Adherence to financial laws and agreements ', 'Sensitivity and accurate implementation of plans and schedules agreed with the organization or other person in financial matters. ', 'Adherence to financial laws and agreements (do not interfere in the financial affairs in which you have been given authority for your own benefit and the benefit of others)', 'Sensitivity and close implementation of plans and schedules agreed with the organization or other person in financial matters.'),
(713, 3, 245, 'پایبندی به قوانین و توافقات مالی(دخل و تصرف نکردن در امور مالی که در آن به شما اختیار داده شده به نفع خود و نفع دیگران )', 'حساسیت و اجرای مو به موی برنامه ها و زمان بندی های توافق شده با سازمان یا شخص دیگر در مسائل مالی.', 'پایبندی به قوانین و توافقات مالی(دخل و تصرف نکردن در امور مالی که در آن به شما اختیار داده شده به نفع خود و نفع دیگران )', 'حساسیت و اجرای مو به موی برنامه ها و زمان بندی های توافق شده با سازمان یا شخص دیگر در مسائل مالی.'),
(714, 1, 246, NULL, NULL, 'Интерес к тишине и покою', 'Оценка 100 для тех, кто всегда предпочитает тишину.'),
(715, 2, 246, ' -Interest in silence and peace', 'A score of 100 is for someone who always prefers silence. ', 'Interest in silence and peace', 'A score of 100 is for someone who always prefers silence.'),
(716, 3, 246, 'علاقمندی به سکوت و آرامش', 'نمره 100 برای کسی است که از نظر صوتی ،همیشه سکوت را ترجیح میدهد.\n', 'علاقمندی به سکوت و آرامش', 'نمره 100 برای کسی است که از نظر صوتی ،همیشه سکوت را ترجیح میدهد.'),
(717, 1, 247, NULL, NULL, 'Важность вашей внешности наедине', '100 баллов — для того, кто заботится о себе так же сильно, как и о других, даже наедине.'),
(718, 2, 247, ' -Importance to your appearance in private', 'the score of 100 is for someone who cares about himself as much as he does in front of others, even in private. ', 'Importance to your appearance in private', 'A score of 100 is for someone who cares about himself as much as he does in front of others, even in private.'),
(719, 3, 247, 'اهمیت به ظاهر خود در خلوت', 'نمره 100 برای کسی است که همانطور که در نزد دیگران خود را اراسته نگه میدارد ،حتی در خلوت خود هم همینقدر به خود اهمیت میدهد.', 'اهمیت به ظاهر خود در خلوت', 'نمره 100 برای کسی است که همانطور که در نزد دیگران خود را اراسته نگه میدارد ،حتی در خلوت خود هم همینقدر به خود اهمیت میدهد.'),
(720, 1, 248, NULL, NULL, 'Обратите внимание на здоровье жены', '100 баллов для того, кто заботится о чистоте и опрятности своей жены.'),
(721, 2, 248, ' -Pay attention to your spouse\'s hygiene', 'the score of 100 is for someone who cares about their spouse\'s  cleanliness and tidiness. ', 'Pay attention to your wife\'s health', 'A score of 100 is for someone who cares about his wife\'s cleanliness and tidiness.'),
(722, 3, 248, 'اهمیت دادن به بهداشت همسر', 'نمره 100 برای کسی است که تمیزی و مرتب بودن همسرش بسیار برایش مهم است.\n', 'اهمیت دادن به بهداشت همسر', 'نمره 100 برای کسی است که تمیزی و مرتب بودن همسرش بسیار برایش مهم است.'),
(723, 1, 249, NULL, NULL, 'Важность внешности жены', '100 баллов – для человека, для которого очень важно тело жены.'),
(724, 2, 249, ' -The importance of the appearance of the spouse', 'the score of 100 is for someone for whom their spouse\'s body is very important. ', 'The importance of the appearance of the wife', 'A score of 100 is for someone for whom the wife\'s body is very important.'),
(725, 3, 249, 'اهمیت به اندام ظاهری همسر', 'نمره 100 برای کسی است که اندام همسر برایش بسیار مهم است.', 'اهمیت به اندام ظاهری همسر', 'نمره 100 برای کسی است که اندام همسر برایش بسیار مهم است.'),
(726, 1, 250, NULL, NULL, 'Загадочный и философский взгляд на вещи, чтобы найти причину', '100 баллов для человека, чьи повседневные дела указывают на своего рода таинственное поведение и делают второстепенные и обычные дела загадочными.'),
(727, 2, 250, 'Enigmatic and philosophical insight to find the reason', 'the score of 100 is for someone whose daily affairs indicate a kind of mysterious behavior and makes unnecessary and ordinary matters mysterious. ', 'Enigmatic and philosophical look at things to find the reason', 'A score of 100 is for someone whose daily affairs indicate a kind of mysterious behavior and makes non-essential and ordinary matters mysterious.'),
(728, 3, 250, 'نگاه معما گونه و فلسفی به امور برای یافتن دلیل', 'نمره 100 برای کسی است که امورات روز مره او حاکی از نوعی رفتار رمز و راز دار است و موضوعات عیر ضروری و معمولی را هم رمز آلود میکند . ', 'نگاه معما گونه و فلسفی به امور برای یافتن دلیل', 'نمره 100 برای کسی است که امورات روز مره او حاکی از نوعی رفتار رمز و راز دار است و موضوعات عیر ضروری و معمولی را هم رمز آلود میکند .'),
(729, 1, 251, NULL, NULL, 'Способность сохранять спокойствие', '100 баллов для того, кто может сохранять спокойствие в кризисных и чрезвычайных ситуациях (в тех случаях, когда проблема не связана с ним лично), таких как землетрясения или...'),
(730, 2, 251, ' -Ability to keep inner calm', 'the score of 100 is for someone who can maintain his calm in crisis and emergency situations (in cases where the issue is not related to him personally) such as earthquake accidents or... ', 'Ability to keep calm', 'A score of 100 is for someone who can maintain his calm in crisis and emergency situations (in cases where the issue is not related to him personally) such as earthquake accidents or...'),
(731, 3, 251, 'توان حفظ آرامش', 'نمره 100 برای کسی است که در شرایط بحران و اضطرار (در مواردیکه موضوع به شخص او مرتبط نیست) مثل تصادفات زلزله و یا ...  میتواند آرامش خود را حفظ کند.    ', 'توان حفظ آرامش', 'نمره 100 برای کسی است که در شرایط بحران و اضطرار (در مواردیکه موضوع به شخص او مرتبط نیست) مثل تصادفات زلزله و یا ...  میتواند آرامش خود را حفظ کند.'),
(732, 3, 252, 'تمایل به آگاهی از ارتباطات همسر', 'نمره 100 برای کسی است که  مدام وسوسه کنترل ارتباطات و یا موبایل و یا مکالمات همسرش را دارد . بدون سابقه قبلی و حتی اگر از نظر تربیتی هم اینکار را نکند از درون اشتیاق زیادی به این کار دارد.', 'تمایل به آگاهی از ارتباطات همسر', 'نمره 100 برای کسی است که  مدام وسوسه کنترل ارتباطات و یا موبایل و یا مکالمات همسرش را دارد . بدون سابقه قبلی و حتی اگر از نظر تربیتی هم اینکار را نکند از درون اشتیاق زیادی به این کار دارد.'),
(733, 1, 253, NULL, NULL, 'Желание быть любопытным в общении супруга', ''),
(734, 2, 253, '-', NULL, 'The desire to be curious in the communication of the spouse', ''),
(735, 3, 253, 'میل به کنجکاوی در ارتباطات همسر', NULL, 'میل به کنجکاوی در ارتباطات همسر', ''),
(736, 1, 254, NULL, NULL, 'Уязвимость от грубых слов', '100 баллов – для человека, который очень расстраивается, злится и впадает в депрессию, услышав грубые слова, и долго не может вернуться к нормальной жизни.'),
(737, 2, 254, ' -Vulnerability from rude words', 'the score of 100 is for someone who gets very upset, angry and depressed after hearing rude words and cannot return to normal state for a long time. ', 'Vulnerability from rude words', 'A score of 100 is for someone who gets very upset, angry and depressed after hearing rude words and cannot return to normal for a long time.'),
(738, 3, 254, 'آسیب پذیری از حرفهای رکیک', 'نمره 100 برای کسی است که پس از شنیدن حرف های رکیک بشدت ناراحت و عصبانی و افسرده میشود و تا مدتها نمیتواند به حالت عادی برگردد.', 'آسیب پذیری از حرفهای رکیک', 'نمره 100 برای کسی است که پس از شنیدن حرف های رکیک بشدت ناراحت و عصبانی و افسرده میشود و تا مدتها نمیتواند به حالت عادی برگردد.'),
(739, 1, 255, NULL, NULL, 'Забота о репутации', '100 баллов — это тот, кто взял на себя обязательство поддерживать свою репутацию, что может быть связано со словами людей или средств массовой информации и т. д.'),
(740, 2, 255, ' -Caring for reputation', 'he score of 100 is for someone who may not give up on anything because of the words of the people or the media, etc. , in order to maintain his/her reputation', 'Caring for reputation', 'A score of 100 is for someone who has made a commitment to maintain his or her reputation, which may be due to the words of the people or the media, etc.'),
(741, 3, 255, 'اهمیت دادن به آبرو', 'نمره 100 برای کسی است که در جهت حفظ ابروی قرار دادیش که ممکن است بخاطر حرف مردم و یا رسانه و ... از هیچ چیزی فرو گذار نباشد ', 'اهمیت دادن به آبرو', 'نمره 100 برای کسی است که در جهت حفظ ابروی قرار دادیش که ممکن است بخاطر حرف مردم و یا رسانه و ... از هیچ چیزی فرو گذار نباشد'),
(742, 1, 256, NULL, NULL, 'Потенциальная уязвимость отказа', '100 баллов – это для того, кто получает душевные и психологические травмы при неудачах (маленьких и больших) и редко находит в себе силы восстановиться.'),
(743, 2, 256, ' -the potential of vulnerability of failure', 'A score of 100 is for someone who suffers mental and psychological injuries when they fail (small and big) and rarely finds the strength to recover. ', 'Potential vulnerability of failure', 'A score of 100 is for someone who suffers mental and psychological injuries when they fail (small and big) and rarely finds the strength to recover.'),
(744, 3, 256, 'پتانسیل آسیب پذیری از شکست', 'نمره 100 برای کسی است که در زمان شکست خوردن (کوچک و بزرگ)دچار اسیب های روحی  و روانی میشود و قدرت باز یافت خود را بندرت پیدا میکند.', 'پتانسیل آسیب پذیری از شکست', 'نمره 100 برای کسی است که در زمان شکست خوردن (کوچک و بزرگ)دچار اسیب های روحی  و روانی میشود و قدرت باز یافت خود را بندرت پیدا میکند.'),
(745, 1, 257, NULL, NULL, 'Понимание слов взрослых', '100 баллов — для тех, кто в детстве может иметь относительно полное понимание предложений, используемых взрослыми.'),
(746, 2, 257, ' -Understanding adults\' words', 'the score of 100 is for someone who can have a relatively complete understanding of the sentences used by adults(in childhood) ', 'Understanding adults\' words', 'A score of 100 is for someone who in childhood can have a relatively complete understanding of the sentences used by adults.'),
(747, 3, 257, 'فهم سخنان بزرگسال', 'نمره 100 برای کسی است که در دوران کودکی میتواند در ک نسبتا کاملی از جملاتی که بزرگترها بکار میبرند داشته باشد .', 'فهم سخنان بزرگسال', 'نمره 100 برای کسی است که در دوران کودکی میتواند در ک نسبتا کاملی از جملاتی که بزرگترها بکار میبرند داشته باشد .'),
(748, 1, 258, ' Уязвимость по причине  презрения других в отношении себя', NULL, 'Уязвимость от унижения', 'Оценка 100 для того, кто, в случае унижения, может страдать от этого и навсегда увидеть в этом влияние в своей жизни.'),
(749, 2, 258, '  -Vulnerability to humiliation', 'the score of 100 is for someone who, in case of being humiliated, can suffer from it and see it as an influence in his life forever.  ', 'Vulnerability from humiliation', 'A score of 100 is for someone who, in case of being humiliated, can suffer from it and see it as an influence in his life forever.'),
(750, 3, 258, 'آسیب پذیری از تحقیردیگران ', 'نمره 100 برای کسی است که در صورت تحقیر شدن میتواند از ان اسیب های روحی ببیند و تا ابد آنرا تاثیر گذار در زندگی خود ببیند.', 'آسیب پذیری از تحقیردیگران', 'نمره 100 برای کسی است که در صورت تحقیر شدن میتواند از ان اسیب های روحی ببیند و تا ابد آنرا تاثیر گذار در زندگی خود ببیند.'),
(751, 1, 259, NULL, NULL, 'Эффективность словесного поощрения', 'Оценка 100 для ребенка, который перед хорошей работой, которую он сделал, если вы поощряете его словесно, получает много энергии и выражает эту проблему и продолжает свою хорошую работу, и этот эффект останется в его существе. .'),
(752, 2, 259, ' -Effectiveness of verbal reinforcement', 'the score of 100 is for a child who, if you encourage him verbally, he gets a lot of energy and expresses this issue and continues his good work, and this effect will remain in his being. ', 'Effectiveness of verbal encouragement', 'A score of 100 is for a child who, in front of a good work he has done, if you encourage him verbally, he gets a lot of energy and expresses this issue and continues his good work, and this effect will remain in his being.'),
(753, 3, 259, 'تاثیر پذیری از تشویق کلامی', 'نمره 100 برای کودکی است که در مقابل کار خوبی که انجام داده چنانچه اورا تشویق کلامی کنید بشدت انرزی گرفته و این موضوع را بیان میکند و به کار خوبش ادامه میدهد و این تاثیر در وجودش ماندگار میشود.', 'تاثیر پذیری از تشویق کلامی', 'نمره 100 برای کودکی است که در مقابل کار خوبی که انجام داده چنانچه اورا تشویق کلامی کنید بشدت انرزی گرفته و این موضوع را بیان میکند و به کار خوبش ادامه میدهد و این تاثیر در وجودش ماندگار میشود.'),
(754, 1, 260, ' Уязвимость здоровья вследствие длительного стресса', NULL, 'Уязвимость к стрессу', 'Оценка 100 для кого-то, кто будет иметь непоправимый физический и психический ущерб от постоянного стресса.'),
(755, 2, 260, '     -Vulnerability to stress', 'the score of 100 is for someone who will have irreparable physical and mental damage from continuous stress.     ', 'Vulnerability to stress', 'A score of 100 is for someone who will have irreparable physical and mental damage from continuous stress.'),
(756, 3, 260, 'اسیب پذیری از استرس', 'نمره 100 برای کسی است که از استرس های مداوم معمولا اسیب های جسمی و روحی جبران ناپذیری خواهد داشت.', 'اسیب پذیری از استرس', 'نمره 100 برای کسی است که از استرس های مداوم معمولا اسیب های جسمی و روحی جبران ناپذیری خواهد داشت.'),
(757, 1, 261, 'Талант к бескорыстной дружбе', NULL, 'искренняя дружба', '100 баллов - для того, кто демонстрирует спокойную дружбу, не зависящую от факторов и не имеющую ожиданий от работы, хотя понимание этого состояния и компенсация его обостряют его чувства. Проще говоря, собаки — лучший пример среди животных.'),
(758, 3, 261, 'دوستی خالصانه', 'نمره 100 برای کسی است که دوستی بی غل و غشی را ارائه میدهد که وابسته به عوامل نیست و در قبال کارها هیچ انتظاری ندارد هرچند که درک این حالتش و جبران ان برایش تشدید کننده حسش میباشد . اگر ساده برسی کنیم در بین حیوانات سگ بهترین مثال است.\n', 'دوستی خالصانه', 'نمره 100 برای کسی است که دوستی بی غل و غشی را ارائه میدهد که وابسته به عوامل نیست و در قبال کارها هیچ انتظاری ندارد هرچند که درک این حالتش و جبران ان برایش تشدید کننده حسش میباشد . اگر ساده برسی کنیم در بین حیوانات سگ بهترین مثال است.'),
(759, 1, 262, NULL, NULL, 'Обвинение себя и сожаление о предыдущих действиях и поведении (у него есть ощущение, что если он захочет сделать то же самое снова, он сделает это лучше)', 'Оценка 100 для того, кто постоянно сожалеет о предыдущих действиях и поведении (у него есть ощущение, что если он захочет сделать то же самое снова, он сделает это лучше)'),
